import React from 'react';

const Form = () => {
    return (
        <form onSubmit={submitHandler}>
            <div>
                <input
                    type="text"
                    className="form-control"
                    placeholder="Введите название заметки"
                />
            </div>
        </form>
    );
};

export default Form;
